import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import './App.css';
import Header from './components/Header/Header';
import ButtonSection from './components/ButtonSection/ButtonSection';
import UseCouponPage from './UseCouponPage';
import ImageSlider from './ImageSlider';

function App() {
  const MainContent = () => (
    <div className="festival-container">
      <Header />

      <div className="main-content">
        <div className="left-section">
          <ImageSlider />  {/* 이미지 슬라이더를 위로 이동 */}
          <div className="title-section">  {/* 타이틀 섹션을 아래로 이동 */}
            <h1 className="festival-name">2024 하늘공원 축제</h1>
            <h2 className="main-title">
              <span className="title-line">모든 잎이 꽃이 되는 가을</span>
              <span className="title-line">오색 찬란한 물결 속으로 당신을 초대합니다</span>
            </h2>
          </div>
        </div>

        <div className="right-section">
          <ButtonSection />
        </div>
      </div>

      <nav className="bottom-nav">
        <div className="nav-icons">
          <div className="nav-icon">축제 기간&nbsp;&nbsp; 2024. 09. 01 ~ 10. 31</div>
        </div>
      </nav>
    </div>
  );

  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<MainContent />} />
          <Route path="/use-coupon" element={<UseCouponPage />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
